INSERT INTO `magazine_article` (`id`, `id_category`, `status`, `title`, `subtitle`, `resume`, `featured`, `image_cover`, `image_article`, `content_article`, `tip_article`, `created`, `modified`) VALUES
(1, 4, 'Y', 'Ford GT renasce', 'Superesportivo carrega motor V6 biturbo de 600 cv', 'Superesportivo carrega motor V6 biturbo de 600 cv', 'a2', 'magazine_cover/2015/0112/14210850033197.jpg', 'magazine_article/2015/0112/14210850062921.jpg', '<p>A importância do carro pode ser observada diante de seus predicados: propulsor no centro dos eixos, tração traseira, fibra de carbono em diversos componentes, rodas de 20 polegadas calçadas com pneu Michelin Pilot Super Sport Cup 2, freios a disco de carbono-cerâmica, transmissão autozatizada de dupla embreagem e sete velocidades, além do mais expressivo item: o motor EcoBoost mais potente da história, sendo um V6 biturbo de 3,5 litros com injeção direta que desenvolve 600 cv.</p>', '<p>Com combustível de alta octanagem correndo pelas veias, a equipe de  jornalistas do WebMotors está sempre acelerando em busca das informações  mais relevantes para quem está á procura do melhor negócio ou é apenas  mais um aficionados por carros!</p>', '2015-01-15 09:57:37', '2015-01-20 10:38:39'),
(6, 4, 'Y', 'Volt e Bolt', 'Chevrolet mostra dupla de elétricos em Detroit.', 'Além do superesportivo, F150 Raptor e Shelby GT350R estarão no game.', 'a1', 'magazine_cover/2015/0112/14210846102670.jpg', 'magazine_article/2015/0112/14210846144955.jpg', '<p>Junto com o lançamento do novo Ford GT no Salão de Detroit, a Microsoft e a Ford anunciaram que o superesportivo será a grande estrela do jogo Forza Motorsport 6, para Xbox One.</p> <p> </p> <p>Figurando a capa do game, o GT ainda trará F150 Raptor e Shelby GT350R para o jogo.  A produtora do jogo, a Turn 10, aproveitou para anunciar que o novo Forza Motorsport será apresentado na E3, maior feira de games do mundo, em junho deste ano.</p> <p> </p> <p>A franquia, exclusiva para o Xbox, completa 10 anos neste ano e o GT faz parte das festividades.</p> <p> </p> <p>"é uma honra poder participar deste momento histórico com a Ford e celebrar o legado do GT colocando-o na capa do Forza Motorsport", disse Phil Spencer, chefe da divisão Xbox da Microsoft.   O novo Ford GT terá o EcoBoost mais potente já feito colocado entro os eixos: um V6 biturbo de 3.5 litros, que produz 600 cv.</p>', '<p>Com combustível de alta octanagem correndo pelas veias, a equipe de  jornalistas do WebMotors está sempre acelerando em busca das informações  mais relevantes para quem está á procura do melhor negócio ou é apenas  mais um aficionados por carros!</p>', '2015-01-15 09:57:37', '2015-01-20 10:38:12'),
(20, 4, 'Y', 'Honda lança NXR160 Bros', 'Informe Publicitário', 'Informe Publicitário', 'a3', 'magazine_cover/2015/0112/14210854584085.jpg', 'magazine_article/2015/0112/14210854615180.jpg', '<p>Acaba de chegar as concessionárias a Nova NXR 160 Bros da Honda, com novo motor FlexOne de 160cc, propiciando arranques e retomadas mais rápidas e freio a disco nas duas rodas (versão ESDD) que possibilita maior equilíbrio durante as frenagens.</p> <p> </p> <p>O design renovado conta com painel digital completo, na cor azul, possui velocímetro, marcador de combustível, hodômetro total e parcial, relógio e luzes espia.</p> <p> </p> <p>Outra grande novidade é a nova tampa de combustível, com visual moderno e articulada ao tanque, proporciona maior praticidade ao abastecer, além dos 3 anos de garantia, que reforça ainda mais o diferencial da marca perante a concorrência.   A Nova NXR 160 Bros é fabricada em Manaus (AM) e chega com três opções de cores: preto, vermelho e branco.</p> <p> </p> <p>O modelo já está em total conformidade com o Promot 4 (Programa de Controle da Poluição do Ar por Motociclos e Veículos Similares).   A moto mais completa da categoria continua pronta para enfrentar qualquer tipo de terreno e está ainda mais forte e mais bonita.   Nova BROS 160cc. Mais Moto.   Motor: 160cc   Cores: Preto, vermelho e Branco.</p> <p> </p> <p>Versões: ESD e ESDD   Preços: R$ 9.350 (ESD) e R$ 9.650 (ESDD).</p>', '<p>Com combustível de alta octanagem correndo pelas veias, a equipe de  jornalistas do WebMotors está sempre acelerando em busca das informações  mais relevantes para quem está á procura do melhor negócio ou é apenas  mais um aficionados por carros!</p>', '2015-01-13 09:57:37', '2015-01-20 10:38:46'),
(26, 3, 'Y', 'Híbrido trimotor', 'Volkswagen apresenta conceito Cross Coupé em Detro', 'Volkswagen apresenta conceito Cross Coupé em Detroit', 'b3', 'magazine_cover/2015/0112/14210861825491.jpg', 'magazine_article/2015/0112/14210861853432.jpg', '<p>O modelo possui cinco modos de direção. O mais chamativo é o E-Mode, acionável por um botão que permite o veículo rodar por 32 quilômetros sem emitir gases poluentes, uma vez que o bloco V6 é desativado.</p>', '<p>Com combustível de alta octanagem correndo pelas veias, a equipe de  jornalistas do WebMotors está sempre acelerando em busca das informações  mais relevantes para quem está á procura do melhor negócio ou é apenas  mais um aficionados por carros!</p>', '2015-01-15 09:57:37', '2015-01-20 10:38:54'),
(30, 4, 'Y', '4C Spider em Detroit', 'Modelo da Alfa Romeo utiliza motor 1.8 turbo de 24', 'Modelo da Alfa Romeo utiliza motor 1.8 turbo de 240 cv', 'b2', 'magazine_cover/2015/0112/14210857466074.jpg', 'magazine_article/2015/0112/14210857503347.jpg', '<p>Com objetivo de cada vez mais fortalecer as marcas do grupo FCA nos Estados Unidos, a Alfa Romeo apresentou nesta segunda-feira, durante o Salão de Detroit, o 4C Spider.</p> <p> </p> <p>Modelo apareceu pela primeira vez, ainda como conceito, no Salão de Genebra, na Suíça, ano passado.</p>', '<p>Com combustível de alta octanagem correndo pelas veias, a equipe de  jornalistas do WebMotors está sempre acelerando em busca das informações  mais relevantes para quem está á procura do melhor negócio ou é apenas  mais um aficionados por carros!</p>', '2015-01-10 09:57:37', '2015-01-20 10:39:02'),
(31, 4, 'Y', 'Fiat 500 renovado', 'Provável facelift é flagrado na Itália', 'Provável facelift é flagrado na Itália. Veja mais.', 'b1', 'magazine_cover/2015/0112/14210864121658.jpg', 'magazine_article/2015/0112/14210864156712.jpg', '<p>Não parece lógico que um carro com design retrô tenha que renovar seu desenho. Pois a<strong> </strong>Fiat deve acreditar que sim, e já está preparando novidades para o Fiat 500<a href="http://www.webmotors.com.br/comprar/carros/novos-usados/veiculos-todos-estados/fiat/500?q=%28%28TypeSearch%3D%5Bcarros-n-loja%5D%29%7C%28TypeSearch%3D%5Bcarros-u-loja%5D%29%7C%28TypeSearch%3D%5Bcarros-n-concessionaria%5D%29%7C%28TypeSearch%3D%5Bcarros-u-concessionaria%5D%29%7C%28TypeSearch%3D%5Bcarros-u-pessoafisica%5D%29%29%26%28%28Make%3D%5BFIAT%5D%29%26%28Model%3D%5B500%5D%29%29"></a>.  Em flagras dos parceiro do AutoMedia, uma unidade com camuflagens na  dianteira e na traseira foi vista rodando por Turim, na Itália.</p> <p> </p> <p>Ao que os disfarçes indicam, as mudanças se tratam de um facelift bem  leve, apenas para para-choques, lanternas e faróis. O interior deve  receber pequenas alterações como novos materiais, nada muito agressivo.  Na mecânica, porém, nenhuma mudança.</p>', '<p>Com combustível de alta octanagem correndo pelas veias, a equipe de  jornalistas do WebMotors está sempre acelerando em busca das informações  mais relevantes para quem está á procura do melhor negócio ou é apenas  mais um aficionados por carros!</p>', '2015-01-15 09:57:37', '2015-01-20 10:39:10');
